PROBLEM: 'Suppose '$S$' cans of soda can be purchased from a vending machine for '$Q$' quarters. Which of the following expressions describes the number of cans of soda that can be purchased for '$D$' dollars, where '$1$' dollar is worth '$4$' quarters?\n'
=======
CHOICES:
[A]: \frac{4DQ}{S}
[B]: \frac{4DS}{Q}
[C]: \frac{4Q}{DS}
[D]: \frac{DQ}{4S}
[E]: \frac{DS}{4Q}

PROBLEM: 'The solutions to the equation '$(z+6)^8=81$' are connected in the complex plane to form a convex regular polygon, three of whose vertices are labeled '$A,B,$' and '$C$'. What is the least possible area of '$\triangle ABC?$'\n'
=======
CHOICES:
[A]: \frac{1}{6}\sqrt{6}
[B]: \frac{3}{2}\sqrt{2}-\frac{3}{2}
[C]: 2\sqrt3-3\sqrt2
[D]: \frac{1}{2}\sqrt{2}
[E]: \sqrt 3-1

PROBLEM: 'Let '$ABCDEF$' be a regular hexagon with side length '$1$'. Denote by '$X$', '$Y$', and '$Z$' the midpoints of sides '$\overline {AB}$', '$\overline{CD}$', and '$\overline{EF}$', respectively. What is the area of the convex hexagon whose interior is the intersection of the interiors of '$\triangle ACE$' and '$\triangle XYZ$'?\n'
=======
CHOICES:
[A]: \frac {3}{8}\sqrt{3}
[B]: \frac {7}{16}\sqrt{3}
[C]: \frac {15}{32}\sqrt{3}
[D]: \frac {1}{2}\sqrt{3}
[E]: \frac {9}{16}\sqrt{3}
